  return (
    <div>
      {Object.keys(inputs).map(key => (
        <React.Fragment key={"rf" + key}>
          <Input
            key={key}
            name={key}
            value={inputs[key]}
            onChange={handleChange}
            sizeClass={"form-control-sm"}
          />
          <button onClick={() => handleDelete(key)} className="btn btn-danger">
            -
          </button>
        </React.Fragment>
      ))}
      <div />
      <button onClick={handleCreate} className="btn btn-success m-2">
        +
      </button>
    </div>
  );
};

export default InputList;
